import React, { Component } from 'react';


class Header extends Component {
  render() {
    return (

        <div className="header">
            <h1>Memory Game</h1>
            <p>{this.props.game.count}</p>
            <p>{this.props.game.topscore}</p>
        </div>
    )
  }
}

export default Header;
